snippet.sync_client:
package com.example.usage;

import com.seed.endpointSecurityAuth.SeedEndpointSecurityAuthClient;
import com.seed.endpointSecurityAuth.resources.auth.requests.GetTokenRequest;

public class Example {
    public static void main(String[] args) {
        SeedEndpointSecurityAuthClient client = SeedEndpointSecurityAuthClient
            .builder()
            .token("<token>")
            .build();

        client.auth().getToken(
            GetTokenRequest
                .builder()
                .clientId("client_id")
                .clientSecret("client_secret")
                .build()
        );
    }
}

